import React from 'react';
import ReactDOM from 'react-dom';
import './App.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';
import state from "./data/state";
import {addMenu} from "./data/state";

const rerenderTree = () => {
  ReactDOM.render(<App state={state} addMenu={addMenu} />, document.getElementById('root'));
}
rerenderTree();


serviceWorker.unregister();
